import axios from "axios"
const imagesUrl = "https://api.creativecommons.engineering/v1/images"


export default function App() {

  const [images, updateimages] = useState([])
  useEffect(() => {
    const apiCall = async () => {
      const images = await axios(imagesUrl)
      console.log(images)
      console.log(images.data)


      updateimages(images.data)
    }
    apiCall()
  }, [])


  return (
    <div>
      <h1>images</h1>
      {/* {countries.map(country => <h2 key={country.nativeName}>{country.}</h2>)} */}

    </div>
  )
}



const countryUrl = "https://restcountries.eu/rest/v2/all"
