    const apiCall = async () => {
      const countries = await axios(countryUrl)
      updateCountries(countries.data)
      console.log(countries)

    }
    apiCall()
  }, [])
  return (
    <div>
      <h1>Countries</h1>

      {countries.map(country => <h2 key={country.nativeName}>{country.cioc}</h2>)}

    </div>
  )
}
